import React, { useState } from 'react';
import { Mail, Phone, MapPin } from 'lucide-react';

const Contact = () => {
  const [formState, setFormState] = useState({
    name: '',
    email: '',
    message: '',
  });

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission
    console.log(formState);
  };

  return (
    <div
      id="contact"
      style={{
        padding: '6rem 0',
        backgroundColor: '#fff',
      }}
    >
      <div
        style={{
          maxWidth: '80rem',
          margin: '0 auto',
          padding: '0 1rem',
        }}
      >
        <div style={{ textAlign: 'center' }}>
          <h2
            style={{
              fontSize: '2rem',
              fontWeight: '800',
              color: '#1f2937',
            }}
          >
            Contact Us
          </h2>
          <p
            style={{
              marginTop: '1rem',
              fontSize: '1.25rem',
              color: '#6b7280',
            }}
          >
            Get in touch with our expert team
          </p>
        </div>

        <div
          style={{
            marginTop: '5rem',
            display: 'grid',
            gridTemplateColumns: '1fr',
            gap: '3rem',
          }}
        >
          {/* Left Side: Contact Info */}
          <div style={{ display: 'grid', gap: '2rem' }}>
            <div style={{ display: 'flex', alignItems: 'start', gap: '1rem' }}>
              <Mail style={{ height: '1.5rem', width: '1.5rem', color: '#fb923c', marginTop: '0.25rem' }} />
              <div>
                <h3
                  style={{
                    fontSize: '1.125rem',
                    fontWeight: '500',
                    color: '#1f2937',
                  }}
                >
                  Email
                </h3>
                <p style={{ marginTop: '0.25rem', color: '#6b7280' }}>info@aifbf.org</p>
              </div>
            </div>
            <div style={{ display: 'flex', alignItems: 'start', gap: '1rem' }}>
              <Phone style={{ height: '1.5rem', width: '1.5rem', color: '#16a34a', marginTop: '0.25rem' }} />
              <div>
                <h3
                  style={{
                    fontSize: '1.125rem',
                    fontWeight: '500',
                    color: '#1f2937',
                  }}
                >
                  Phone
                </h3>
                <p style={{ marginTop: '0.25rem', color: '#6b7280' }}>+91 8792006430</p>
              </div>
            </div>
            <div style={{ display: 'flex', alignItems: 'start', gap: '1rem' }}>
              <MapPin style={{ height: '1.5rem', width: '1.5rem', color: '#fb923c', marginTop: '0.25rem' }} />
              <div>
                <h3
                  style={{
                    fontSize: '1.125rem',
                    fontWeight: '500',
                    color: '#1f2937',
                  }}
                >
                  Address
                </h3>
                <p style={{ marginTop: '0.25rem', color: '#6b7280' }}>
                  ANDAPURA VILLAGE, ATTIBELE HOBLI, ANEKAL TALUK,
                  <br />
                  ELECTRONIC CITY POST, Bengaluru Karnataka, 560100
                </p>
              </div>
            </div>
          </div>

          {/* Right Side: Contact Form */}
          <div
            style={{
              backgroundColor: '#f9fafb',
              padding: '2rem',
              borderRadius: '0.75rem',
            }}
          >
            <form onSubmit={handleSubmit} style={{ display: 'grid', gap: '1.5rem' }}>
              <div>
                <label
                  htmlFor="name"
                  style={{
                    display: 'block',
                    fontSize: '0.875rem',
                    fontWeight: '500',
                    color: '#374151',
                  }}
                >
                  Name
                </label>
                <input
                  type="text"
                  id="name"
                  style={{
                    marginTop: '0.25rem',
                    display: 'block',
                    width: '100%',
                    borderRadius: '0.375rem',
                    border: '1px solid #d1d5db',
                    padding: '0.5rem',
                    boxShadow: '0 1px 2px rgba(0, 0, 0, 0.05)',
                  }}
                  value={formState.name}
                  onChange={(e) => setFormState({ ...formState, name: e.target.value })}
                  required
                />
              </div>
              <div>
                <label
                  htmlFor="email"
                  style={{
                    display: 'block',
                    fontSize: '0.875rem',
                    fontWeight: '500',
                    color: '#374151',
                  }}
                >
                  Email
                </label>
                <input
                  type="email"
                  id="email"
                  style={{
                    marginTop: '0.25rem',
                    display: 'block',
                    width: '100%',
                    borderRadius: '0.375rem',
                    border: '1px solid #d1d5db',
                    padding: '0.5rem',
                    boxShadow: '0 1px 2px rgba(0, 0, 0, 0.05)',
                  }}
                  value={formState.email}
                  onChange={(e) => setFormState({ ...formState, email: e.target.value })}
                  required
                />
              </div>
              <div>
                <label
                  htmlFor="message"
                  style={{
                    display: 'block',
                    fontSize: '0.875rem',
                    fontWeight: '500',
                    color: '#374151',
                  }}
                >
                  Message
                </label>
                <textarea
                  id="message"
                  rows={4}
                  style={{
                    marginTop: '0.25rem',
                    display: 'block',
                    width: '100%',
                    borderRadius: '0.375rem',
                    border: '1px solid #d1d5db',
                    padding: '0.5rem',
                    boxShadow: '0 1px 2px rgba(0, 0, 0, 0.05)',
                  }}
                  value={formState.message}
                  onChange={(e) => setFormState({ ...formState, message: e.target.value })}
                  required
                />
              </div>
              <button
                type="submit"
                style={{
                  width: '100%',
                  backgroundColor: '#2563eb',
                  color: '#fff',
                  padding: '0.75rem',
                  borderRadius: '0.375rem',
                  fontSize: '1rem',
                  fontWeight: '500',
                  cursor: 'pointer',
                  transition: 'background-color 0.3s',
                }}
                onMouseOver={(e) => (e.target.style.backgroundColor = '#1d4ed8')}
                onMouseOut={(e) => (e.target.style.backgroundColor = '#2563eb')}
              >
                Send Message
              </button>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Contact;
